function maxCollectedFruits(fruits: number[][]): number {
    const n: number = fruits.length;
    const memo: number[][] = new Array(n).fill(0).map(() => new Array(n).fill(-1));

    const firstShifts: number[][] = [[1, -1], [1, 0], [1, 1]];
    const secondShifts: number[][] = [[-1, 1], [0, 1], [1, 1]];

    const isNotValid = (row: number, col: number, steps: number, first: boolean) => {
        if (row < 0 || row === n || col < 0 || col === n) {
            return true;
        };

        if (first && col < steps) {
            return true;
        }
        if (!first && row < steps) {
            return true;
        }

        return false;
    }

    const getDoublePath = (row: number, col: number, steps: number, first: boolean): number => {
        if (row === n-1 && col === n-1 && steps === n-1) {
            return 0;
        }

        if (steps === n-1) {
            return Number.NEGATIVE_INFINITY;
        }

        if (memo[row][col] !== -1) {
            return memo[row][col];
        }

        let res: number = Number.NEGATIVE_INFINITY;
        const shifts = first ? firstShifts : secondShifts;

        for (let [sr, sc] of shifts) {
            const newRow = sr + row;
            const newCol = sc + col;

            if (isNotValid(newRow, newCol, steps + 1, first)) {
                continue;
            }

            const tmp: number = fruits[newRow][newCol];
            fruits[newRow][newCol] = 0;

            const r = getDoublePath(newRow, newCol, steps + 1, first);

            res = Math.max(res, tmp + r);

            fruits[newRow][newCol] = tmp;
        }

        memo[row][col] = res;

        return res;
    }

    let res: number = 0;
    for (let i: number = 0; i < n; ++i) {
        res += fruits[i][i];
        fruits[i][i] = 0;
    }

    res += fruits[0][n-1];
    fruits[0][n-1] = 0;
    res += fruits[n-1][0];
    fruits[n-1][0] = 0;

    res += getDoublePath(0, n-1, 0, true);
    res += getDoublePath(n-1, 0, 0, false);

    return res;
};

